.grid-container {
  border-radius: 25px;
  display: grid;
  grid-template-columns: auto auto auto;
  grid-column-gap: 0px;
}
.post {
  margin-bottom: 10px;
  margin-right: 10px;
  padding: 1px 20px;
  background-color: black;
  border-radius: 25px;
  color: white;
  max-width: 280px;
  min-width: 210px;
}
@media (min-width: 710px) and (max-width: 900px) {
  .grid-container {
    border-radius: 25px;
    display: block !important;
  }
}
